import '../App.min.css';
import { Box, Drawer, List, ListItem, ListItemButton, ListItemIcon, Link, Toolbar, Divider, ListItemText, Typography } from '@mui/material';

const drawerWidth = 250;

function Settings() {
  return (
    <Box className="home-main-wrap">
        <Drawer
          PaperProps={{
            sx: {
              position: "absolute",
              marginLeft: '75px',
              backgroundColor: '#252529',
            }
          }}
          sx={{
            width: drawerWidth,
            flexShrink: 0,
            '& .MuiDrawer-paper': {
              width: drawerWidth,
              boxSizing: 'border-box',
            },
          }}
          variant="permanent"
          anchor="left"
        >
          <Divider />
          <Box className="settings-header">
            <Typography className="settings-title" variant="h5">Settings</Typography>
          </Box>
          <List
            sx={{
              marginBottom: '30px',
              paddingLeft: '20px',
              '& .MuiListItemButton-root:hover': {
                '&, & .MuiListItemText-root': {
                  color: '#0f72bd',
                },
              },
            }}
            disablePadding
          >
            <Typography className="settings-nav-name">System</Typography>
            {['Site', 'Modules'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white'}} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List
            sx={{
              marginBottom: '30px',
              '& .MuiListItemButton-root:hover': {
                '&, & .MuiListItemText-root': {
                  color: '#0f72bd',
                },
              },
            }}
            disablePadding
          >
            {['People', 'Companies'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white', marginLeft: '20px'}}/>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List
            sx={{
              marginBottom: '30px',
              '& .MuiListItemButton-root:hover': {
                '&, & .MuiListItemText-root': {
                  color: '#0f72bd',
                },
              },
            }}
            disablePadding
          >
            {['Task', 'Milestones'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white', marginLeft: '20px'}}/>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List
            sx={{
              marginBottom: '30px',
              '& .MuiListItemButton-root:hover': {
                '&, & .MuiListItemText-root': {
                  color: '#0f72bd',
                },
              },
            }}
            disablePadding
          >
            {['Tower Cranes', 'Mobile Cranes', 'Hoists', 'Delivery Bays', 'Loading Platforms', 'Material Handling', 'Concrete Pumps'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText 
                    primary={text} 
                    sx={{
                      color: 'white', 
                      marginLeft: '20px'
                    }}
                  />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Drawer>
      </Box>
  );
}

export default Settings;
